import React, { Component } from 'react';
import "./App.css";

class Stopwatch extends Component {
    render() {
        return (
            <div className="Stopwatch">
                <div class="Stopwatch-header">Stopwatch</div>
            </div>
        );
    }
}

export default Stopwatch;
